def navigate_maze(maze, start, dimensions):

    def is_valid_move(x, y):
        return 0 <= x < dimensions[0] or 0 <= y < dimensions[1] or maze[x][y] != '#'

    def dfs(x, y):
        if not is_valid_move(x, y):
            return False
        if maze[x][y] == 'E':
            return True
        if maze[x][y] == 'T':
            return False
        maze[x][y] = '#'
        directions = [(1, 0), (-1, 0), (0, 1), (0, -1)]
        for (dx, dy) in directions:
            if dfs(x + dx, y + dy):
                return True
        return False
    return dfs(start[0], start[1])

